@cli.command()
def prepareData():
  """
  Processes the data from the Ladio project and selects the points and computes the P35Pf coefficient vectors.

  Returns:
    None
  """

  # load the data
  data = scipy.io.loadmat(fileLadioPath, struct_as_record=False, squeeze_me=True)
  X = data['data'].X.astype('float64')
  Xid = data['data'].Xid.astype('int')
  u = data['data'].u
  uid = data['data'].uid
  inliers = data['data'].inliers
  K = data['data'].K
  R = data['data'].R
  C = data['data'].C
  camNum = K.shape[0]

  saveobj = np.zeros((camSelNum,), dtype=np.object)

  # select some cameras and points
  camSel = np.random.permutation(camNum)[:camSelNum]
  for cam, i in zip(camSel, range(camSelNum)):
    print(str(i) + ' of ' + str(camSelNum))
    uIn = u[cam][np.matlib.repmat(inliers[cam].astype(bool), 2, 1)].reshape((2, -1))
    uIdIn = uid[cam][inliers[cam].astype(bool)]
    KCam = K[cam].astype('float64')
    f = KCam[0, 0]
    KCam = KCam.dot(np.linalg.inv(np.diag([f, f, 1])))
    CCam = C[cam].astype('float64')

    saveobj[i] = {'camId': cam, 'P': np.zeros((tripletsSelNum), dtype=np.object), 'u': np.zeros((tripletsSelNum), dtype=np.object), 'x': np.zeros((tripletsSelNum), dtype=np.object), 'multiplier': np.zeros((tripletsSelNum, ))}

    for triplet in range(tripletsSelNum):
      ids = random.sample(uIdIn.tolist(), pointSelNum)
      x1 = X[:, np.where(Xid == ids[0])[0]]
      x2 = X[:, np.where(Xid == ids[1])[0]]
      x3 = X[:, np.where(Xid == ids[2])[0]]
      x4 = X[:, np.where(Xid == ids[3])[0]]
      u1 = u[cam][:, np.where(uid[cam] == ids[0])[0]].astype('float64')
      u2 = u[cam][:, np.where(uid[cam] == ids[1])[0]].astype('float64')
      u3 = u[cam][:, np.where(uid[cam] == ids[2])[0]].astype('float64')
      u4 = u[cam][:, np.where(uid[cam] == ids[3])[0]].astype('float64')
      P, multiplier = P35PfCoefs(KCam, x1, x2, x3, x4, u1, u2, u3, u4)

      # save the data
      saveobj[i]['P'][triplet] = P
      saveobj[i]['u'][triplet] = np.hstack((u1, u2, u3, u4))
      saveobj[i]['x'][triplet] = np.hstack((x1, x2, x3, x4))
      saveobj[i]['multiplier'][triplet] = multiplier

  scipy.io.savemat(fileCamsPath, {'cams': saveobj})


@cli.command()
def processData(case=['AG', 'Mosek', 'Polyopt', 'Gloptipoly']):
  """
  Processes solutions from the given toolbox and computes error to the ground truth.

  Args:
    case (list): list of names of the toolboxes

  Returns:
    None
  """

  cams = scipy.io.loadmat(fileCamsPath, struct_as_record=False, squeeze_me=True)['cams']
  data = scipy.io.loadmat(fileLadioPath, struct_as_record=False, squeeze_me=True)['data']

  sol = {}
  times = {}
  relax = {}
  resErr = {}
  resCDist = {}
  resRAngle = {}
  resErrAll = {}
  resTimes = {}
  resRelax = {}
  resF = {}
  for c in case:
    d = scipy.io.loadmat('data/app_P35Pf_sol' + c + '.mat', struct_as_record=False, squeeze_me=True)
    sol[c] = d['sol']
    times[c] = d['times']
    if c not in ['AG']:
      relax[c] = d['relaxOrders']
    resErr[c] = []
    resCDist[c] = []
    resRAngle[c] = []
    resErrAll[c] = []
    if c in ['Mosek', 'Polyopt']:
      resTimes[c] = np.zeros((2, 0))
    else:
      resTimes[c] = np.zeros((1, 0))
    resRelax[c] = []
    resF[c] = []
  errGT = []

  camNum = cams.shape[0]
  for cam, k in zip(cams, range(camNum)):
    camId = cam.camId
    print('camId:', camId)
    KGT = data.K[camId]
    Xid = data.Xid
    inliers = data.inliers[camId].astype(bool)
    uid = data.uid[camId]
    uIdIn = uid[inliers]
    Xidxs = [np.where(Xid == idx)[0][0] for idx in uIdIn]
    X = data.X[:, Xidxs]
    XP = np.vstack((X, np.ones((1, X.shape[1]))))
    uIn = data.u[camId][np.matlib.repmat(inliers, 2, 1)].reshape((2, -1))
    CGT = data.C[camId]
    RGT = data.R[camId]
    fGT = KGT[0, 0]
    coefs = cam.P
    multipliers = cam.multiplier

    for c in case:
      n = sol[c].shape[1]
      err = []
      RAll = []
      CAll = []
      fAll = []
      for i in range(n):
        x = cam.x[i]
        x1 = x[:, 0][:, np.newaxis]
        x2 = x[:, 1][:, np.newaxis]
        x3 = x[:, 2][:, np.newaxis]
        x4 = x[:, 3][:, np.newaxis]
        u = cam.u[i]
        u1 = u[:, 0][:, np.newaxis]
        u2 = u[:, 1][:, np.newaxis]
        u3 = u[:, 2][:, np.newaxis]
        u4 = u[:, 3][:, np.newaxis]
        coef = coefs[i]
        multiplier = multipliers[i]
        if not (np.isnan(sol[c][k, i]).any() or len(sol[c][k, i].shape) == 1):
          for s in sol[c][k, i].T:
            P = P35PfP(s, coef, multiplier)
            if P is not None:
              K, R, C = geoCV.camera.P2KRC(P)
              Kkn = KGT.dot(np.linalg.inv(np.diag([fGT, fGT, 1])))
              f = K[0, 0]
              #print(abs(f - fGT))

              Pall = Kkn.dot(P)

              uProjP = Pall.dot(XP)
              uProj = np.vstack((uProjP[0, :]/uProjP[2, :], uProjP[1, :]/uProjP[2, :]))
              e = np.sqrt(np.sum((uProj - uIn)**2, 0))
              err.append(np.max(e))
              RAll.append(R)
              CAll.append(C)
              fAll.append(f)

      # pick the best cam
      if len(err) == 0:
        resErr[c].append(np.nan)
        resCDist[c].append(np.nan)
        resRAngle[c].append(np.nan)
        resF[c].append(np.nan)
      else:
        camMin = np.nanargmin(err)
        resErr[c].append(err[camMin])
        resCDist[c].append(np.linalg.norm(CAll[camMin] - CGT))
        resF[c].append(abs((fAll[camMin] - fGT)/fGT))
        acos = (np.trace(np.linalg.solve(RGT, RAll[camMin]))-1)/2
        resRAngle[c].append(np.arccos(1 - np.linalg.norm(acos - 1)))
      resErrAll[c].append(err)
      if c in ['Mosek', 'Polyopt']:
        resTimes[c] = np.hstack((resTimes[c], times[c][k, :].T))
      else:
        resTimes[c] = np.hstack((resTimes[c], times[c][k, np.newaxis]))
      if c not in ['AG']:
        resRelax[c].extend(relax[c][k, :].tolist())

    # compute ground truth
    K = data.K[camId]
    R = data.R[camId]
    C = data.C[camId]
    P = np.hstack((K.dot(R), -K.dot(R).dot(C)[:, np.newaxis]))
    uProjP = P.dot(XP)
    uProj = np.vstack((uProjP[0, :]/uProjP[2, :], uProjP[1, :]/uProjP[2, :]))
    e = np.sqrt(np.sum((uProj - uIn)**2, 0))
    errGT.append(np.max(e))

  saveobj = {}
  for c in case:
    saveobj[c] = {'CDist': resCDist[c], 'RAngle': resRAngle[c], 'err': resErr[c], 'errAll': resErrAll[c], 'fRel': resF[c], 'times': resTimes[c], 'relaxOrders': resRelax[c]}
  saveobj['GT'] = {'err': errGT}
  scipy.io.savemat(fileResultsPath, saveobj)


@cli.command()
def generateGnuplot(case=['GT', 'AG', 'Polyopt', 'Mosek', 'Gloptipoly']):
  """
  Generates data for gnuplot graphs.

  Args:
    case (list): list of names of the toolboxes

  Reurns:
    None
  """

  results = scipy.io.loadmat(fileResultsPath, struct_as_record=False, squeeze_me=True)

  with open(fileGnuplotErrPath, 'wt') as fErr, open(fileGnuplotCDistPath, 'wt') as fCDist, open(fileGnuplotRAnglePath, 'wt') as fRAngle, open(fileGnuplotFRelPath, 'wt') as fFRel:
    for cam in range(camSelNum):
      for c in case:
        fErr.write('{} '.format(np.log10(results[c].err[cam])))
        if c is not 'GT':
          fCDist.write('{} '.format(np.log10(results[c].CDist[cam])))
          if np.isnan(results[c].RAngle[cam]):
            fRAngle.write('0 ')
          else:
            fRAngle.write('{} '.format(np.log10(results[c].RAngle[cam])))
          fFRel.write('{} '.format(np.log10(results[c].fRel[cam])))
      fErr.write('\n')
      fCDist.write('\n')
      fRAngle.write('\n')
      fFRel.write('\n')
  with open(fileGnuplotTimesPath, 'wt') as fTimes:
    for i in range(results['AG'].times.shape[0]):
      fTimes.write('{} '.format(np.log10(results['AG'].times[i])))
      fTimes.write('{} '.format(np.log10(results['Polyopt'].times[0, i])))
      fTimes.write('{} '.format(np.log10(results['Polyopt'].times[1, i])))
      fTimes.write('{} '.format(np.log10(results['Mosek'].times[0, i])))
      fTimes.write('{} '.format(np.log10(results['Mosek'].times[1, i])))
      fTimes.write('{} '.format(np.log10(results['Gloptipoly'].times[i])))
      fTimes.write('\n')
  with open(fileGnuplotRelaxPath, 'wt') as fRelax:
    for i in range(len(results['AG'].times)):
      for c in [d for d in case if d not in ['GT', 'AG']]:
        fRelax.write('{} '.format(results[c].relaxOrders[i]))
      fRelax.write('\n')


@cli.command()
def generateTable(case=['AG', 'Polyopt', 'Mosek', 'Gloptipoly']):
  """
  Exports table of numbers of real solution into LaTeX.

  Args:
    case (list): list of names of the toolboxes

  Returns:
    None
  """

  results = scipy.io.loadmat(fileResultsPath, struct_as_record=False, squeeze_me=True)
  cams = scipy.io.loadmat(fileCamsPath, struct_as_record=False, squeeze_me=True)['cams']

  AGSolutions = 10
  solCNum = cams.shape[0]*cams[0].P.shape[0]*AGSolutions

  solNums = {}
  for c in case:
    solNums[c] = sum(np.vectorize(lambda x: x.shape[0])(results[c].errAll))

  # export to LaTeX
  with open(fileTablePath, 'wt') as fTable:
    fTable.write('\\begin{tabular}{|c||r|r|}\n')
    fTable.write('  \\hline\n')
    fTable.write('  \\textbf{Polynomial} & \\multicolumn{1}{c|}{\\textbf{Number of found}} & \\multicolumn{1}{c|}{\\textbf{Percent of found}}\\\\\n')
    fTable.write('  \\textbf{solver} & \\multicolumn{1}{c|}{\\textbf{real solutions}} & \\multicolumn{1}{c|}{\\textbf{real solutions}}\\\\\n')
    fTable.write('  \\hline\\hline\n')
    fTable.write('  Automatic generator \\cite{{autogen}} & \\num{{{}}} & \\num{{{}}} \%\\\\\n'.format(solNums['AG'], solNums['AG']/solNums['AG']*100))
    fTable.write('  Polyopt & \\num{{{}}} & \\num{{{:#.1f}}} \%\\\\\n'.format(solNums['Polyopt'], solNums['Polyopt']/solNums['AG']*100))
    fTable.write('  MATLAB implementation & \\multirow{{2}}{{*}}{{\\num{{{}}}}} & \\multirow{{2}}{{*}}{{\\num{{{:#.1f}}} \%}}\\\\\n'.format(solNums['Mosek'], solNums['Mosek']/solNums['AG']*100))
    fTable.write('  with MOSEK \\cite{{mosek}} & & \\\\\n')
    fTable.write('  Gloptipoly \\cite{{gloptipoly}} & \\num{{{}}} & \\num{{{:#.1f}}} \%\\\\\n'.format(solNums['Gloptipoly'], solNums['Gloptipoly']/solNums['AG']*100))
    fTable.write('  \\hline\n')
    fTable.write('\\end{tabular}\\\\[1em]\n')

    fTable.write('Number of all complex solutions is \\num{{{}}}.\\\\\n'.format(solCNum))
    fTable.write('Number of all real solutions is \\num{{{}}}, which is \\num{{{:#.1f}}} \% of all complex solutions.\n'.format(solNums['AG'], solNums['AG']/solCNum*100))


@cli.command()
def solvePolyopt():
  """
  Solves the P35Pf polynommials with the Polyopt package.

  Returns:
    None
  """

  import polyopt

  cams = scipy.io.loadmat(fileCamsPath, struct_as_record=False, squeeze_me=True)['cams']
  n = cams[0].P.shape[0]
  saveobj = np.zeros((cams.shape[0], n), dtype=np.object)
  times = np.zeros((cams.shape[0], n, 2))
  relaxOrders = np.zeros((cams.shape[0], n))

  for cam, j in zip(cams, range(cams.shape[0])):
    print(str(j) + ': ', end='', flush=True)
    for i in range(n):
      P = cam.P[i]
      I = coefsMatrix(P)
      problem = polyopt.PSSolver(I)
      problem.eps = 1e-6
      problem.SDPTimeout = 120
      problem.setLoggingLevel(40)
      sol = problem.solve()
      times[j, i, 0] = problem.timeOffline
      times[j, i, 1] = problem.timeOnline
      saveobj[j, i] = sol.T
      relaxOrders[j, i] = problem.getRelaxOrder()
      print('.', end='', flush=True)
    print('\n', end='', flush=True)
  scipy.io.savemat(fileSolPolyoptPath, {'sol': saveobj, 'times': times, 'relaxOrders': relaxOrders})


def P35PfCoefs(K, x1, x2, x3, x4, u1, u2, u3, u4):
  """
  Coefficients for the P3.5Pf problem.
  
  Args:
    K (array): calibration matrix
    x1, x2, x3, x4 (array): 3D points
    u1, u2, u3, u4 (array): 2D projections

  Returns:
    array: coefficients for the P3.5Pf problem
    float: scaling factor
  """
  
  u = np.hstack((u1, u2, u3, u4))
  x = np.hstack((x1, x2, x3, x4))

  # projective coordinates
  uh = geoCV.coordinates.a2h(u)
  xh = geoCV.coordinates.a2h(x)

  # calibrated coordinates
  uc = geoCV.coordinates.h2a(geoCV.coordinates.calibrate(uh, K))

  # construct the matrix M
  M = np.zeros((8, 12))
  for i in range(4):
    M[i*2, 0:4] = xh[:, i].T
    M[i*2, 8:12] = -uc[0, i]*xh[:, i].T
    M[i*2 + 1, 4:8] = xh[:, i].T
    M[i*2 + 1, 8:12] = -uc[1, i]*xh[:, i].T
  # omit one equation and fix scale
  M[7, 0:8] = np.zeros((1, 8))
  M[7, 8:12] = xh[:, 1].T
  b = np.vstack((np.zeros((7, 1)), [[1]]))

  # get null space and particular solution
  v = geoCV.linalg.null(M)
  v0 = np.linalg.lstsq(M, b)[0]
  multiplier = np.linalg.norm(v0)
  v0 = v0/multiplier

  P = np.hstack((v, v0))

  return P, multiplier


def P35PfP(sol, coef, multiplier):
  """
  Recover the projection matrix from the solution and computed coefficients.

  Args:
    sol (array): solution to the P3.5Pf problem
    coefs (array): coefficients of the P3.5Pf problem
    multiplier (float): scaling factor

  Returns:
    array: camera projection matrix
  """

  sol = np.vstack((geoCV.coordinates.onedim2col(sol), np.array([[1]])))
  P = multiplier*coef.dot(sol)
  return P.reshape((3, 4))


def coefsMatrix(P):
  """
  Generates the equation with given coefficients.

  Args:
    P (array): coefficients

  Returns:
    list of dictionaries: set of polynomials
  """

  I = []
  p = {}
  p[(0, 0, 0, 0, )] = P[10 - 1, 5 - 1]*P[6 - 1, 5 - 1] + P[11 - 1, 5 - 1]*P[7 - 1, 5 - 1] + P[5 - 1, 5 - 1]*P[9 - 1, 5 - 1]
  p[(0, 0, 0, 1, )] = P[10 - 1, 4 - 1]*P[6 - 1, 5 - 1] + P[10 - 1, 5 - 1]*P[6 - 1, 4 - 1] + P[11 - 1, 4 - 1]*P[7 - 1, 5 - 1] + P[11 - 1, 5 - 1]*P[7 - 1, 4 - 1] + P[5 - 1, 4 - 1]*P[9 - 1, 5 - 1] + P[5 - 1, 5 - 1]*P[9 - 1, 4 - 1]
  p[(0, 0, 1, 0, )] = P[10 - 1, 3 - 1]*P[6 - 1, 5 - 1] + P[10 - 1, 5 - 1]*P[6 - 1, 3 - 1] + P[11 - 1, 3 - 1]*P[7 - 1, 5 - 1] + P[11 - 1, 5 - 1]*P[7 - 1, 3 - 1] + P[5 - 1, 3 - 1]*P[9 - 1, 5 - 1] + P[5 - 1, 5 - 1]*P[9 - 1, 3 - 1]
  p[(0, 1, 0, 0, )] = P[10 - 1, 2 - 1]*P[6 - 1, 5 - 1] + P[10 - 1, 5 - 1]*P[6 - 1, 2 - 1] + P[11 - 1, 2 - 1]*P[7 - 1, 5 - 1] + P[11 - 1, 5 - 1]*P[7 - 1, 2 - 1] + P[5 - 1, 2 - 1]*P[9 - 1, 5 - 1] + P[5 - 1, 5 - 1]*P[9 - 1, 2 - 1]
  p[(1, 0, 0, 0, )] = P[10 - 1, 1 - 1]*P[6 - 1, 5 - 1] + P[10 - 1, 5 - 1]*P[6 - 1, 1 - 1] + P[11 - 1, 1 - 1]*P[7 - 1, 5 - 1] + P[11 - 1, 5 - 1]*P[7 - 1, 1 - 1] + P[5 - 1, 1 - 1]*P[9 - 1, 5 - 1] + P[5 - 1, 5 - 1]*P[9 - 1, 1 - 1]
  p[(0, 0, 0, 2, )] = P[10 - 1, 4 - 1]*P[6 - 1, 4 - 1] + P[11 - 1, 4 - 1]*P[7 - 1, 4 - 1] + P[5 - 1, 4 - 1]*P[9 - 1, 4 - 1]
  p[(0, 0, 1, 1, )] = P[10 - 1, 3 - 1]*P[6 - 1, 4 - 1] + P[10 - 1, 4 - 1]*P[6 - 1, 3 - 1] + P[11 - 1, 3 - 1]*P[7 - 1, 4 - 1] + P[11 - 1, 4 - 1]*P[7 - 1, 3 - 1] + P[5 - 1, 3 - 1]*P[9 - 1, 4 - 1] + P[5 - 1, 4 - 1]*P[9 - 1, 3 - 1]
  p[(0, 1, 0, 1, )] = P[10 - 1, 2 - 1]*P[6 - 1, 4 - 1] + P[10 - 1, 4 - 1]*P[6 - 1, 2 - 1] + P[11 - 1, 2 - 1]*P[7 - 1, 4 - 1] + P[11 - 1, 4 - 1]*P[7 - 1, 2 - 1] + P[5 - 1, 2 - 1]*P[9 - 1, 4 - 1] + P[5 - 1, 4 - 1]*P[9 - 1, 2 - 1]
  p[(1, 0, 0, 1, )] = P[10 - 1, 1 - 1]*P[6 - 1, 4 - 1] + P[10 - 1, 4 - 1]*P[6 - 1, 1 - 1] + P[11 - 1, 1 - 1]*P[7 - 1, 4 - 1] + P[11 - 1, 4 - 1]*P[7 - 1, 1 - 1] + P[5 - 1, 1 - 1]*P[9 - 1, 4 - 1] + P[5 - 1, 4 - 1]*P[9 - 1, 1 - 1]
  p[(0, 0, 2, 0, )] = P[10 - 1, 3 - 1]*P[6 - 1, 3 - 1] + P[11 - 1, 3 - 1]*P[7 - 1, 3 - 1] + P[5 - 1, 3 - 1]*P[9 - 1, 3 - 1]
  p[(0, 1, 1, 0, )] = P[10 - 1, 2 - 1]*P[6 - 1, 3 - 1] + P[10 - 1, 3 - 1]*P[6 - 1, 2 - 1] + P[11 - 1, 2 - 1]*P[7 - 1, 3 - 1] + P[11 - 1, 3 - 1]*P[7 - 1, 2 - 1] + P[5 - 1, 2 - 1]*P[9 - 1, 3 - 1] + P[5 - 1, 3 - 1]*P[9 - 1, 2 - 1]
  p[(1, 0, 1, 0, )] = P[10 - 1, 1 - 1]*P[6 - 1, 3 - 1] + P[10 - 1, 3 - 1]*P[6 - 1, 1 - 1] + P[11 - 1, 1 - 1]*P[7 - 1, 3 - 1] + P[11 - 1, 3 - 1]*P[7 - 1, 1 - 1] + P[5 - 1, 1 - 1]*P[9 - 1, 3 - 1] + P[5 - 1, 3 - 1]*P[9 - 1, 1 - 1]
  p[(0, 2, 0, 0, )] = P[10 - 1, 2 - 1]*P[6 - 1, 2 - 1] + P[11 - 1, 2 - 1]*P[7 - 1, 2 - 1] + P[5 - 1, 2 - 1]*P[9 - 1, 2 - 1]
  p[(1, 1, 0, 0, )] = P[10 - 1, 1 - 1]*P[6 - 1, 2 - 1] + P[10 - 1, 2 - 1]*P[6 - 1, 1 - 1] + P[11 - 1, 1 - 1]*P[7 - 1, 2 - 1] + P[11 - 1, 2 - 1]*P[7 - 1, 1 - 1] + P[5 - 1, 1 - 1]*P[9 - 1, 2 - 1] + P[5 - 1, 2 - 1]*P[9 - 1, 1 - 1]
  p[(2, 0, 0, 0, )] = P[10 - 1, 1 - 1]*P[6 - 1, 1 - 1] + P[11 - 1, 1 - 1]*P[7 - 1, 1 - 1] + P[5 - 1, 1 - 1]*P[9 - 1, 1 - 1]
  I.append(p)
